import React from "react";
import "./skeletonClientProfile.scss";

const SkeletonClientProfile = (props) => {
  const { count, isSkeletonLoading } = props;

  const bindSkeleton = () => {
    let html = [];
    for (var i = 0; i < count; i++) {
      html.push(
        <>  
          <div className="container">
            <div
              className="row justify-content-between"
              style={{ marginBottom: "5rem" }}
            >
              {/* left area */}
              <div className="col-lg-4">
                <div
                  key={`skeleton${[i]}`}
                  className="card_box skeletonClientProfile_Card"
                  hidden={!isSkeletonLoading}
                  style={{ marginTop: i == 0 ? "20px" : "10px" }}
                >
                  <div className="row justify-content-between">
                    <div className="col-md-12">
                      {/* user profile section line */}
                      <div className="row justify-content-between">
                        {/* img icon */}
                        <div className="col-md-4 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "80px",
                              maxWidth: "100%",
                              margin: "5px 0 0",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "80px" }}
                            ></div>
                          </div>
                        </div>
                        {/* name */}
                        <div className="col-md-8 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "16px",
                              maxWidth: "45%",
                              margin: "15px 0 10px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "16px" }}
                            ></div>
                          </div>

                          {/* price section */}
                          <div className="row justify-content-between">
                            {/* 1 */}
                            <div className="col-md-6 skeleton-card-title">
                              <div
                                className="placeholder"
                                style={{
                                  minHeight: "15px",
                                  maxWidth: "70%",
                                  margin: "5px 0 15px",
                                }}
                              >
                                <div
                                  className="animated-background"
                                  style={{ height: "15px" }}
                                ></div>
                              </div>
                            </div>

                            <div className="col-md-6 skeleton-card-title">
                              <div
                                className="placeholder"
                                style={{
                                  minHeight: "15px",
                                  maxWidth: "70%",
                                  margin: "5px 0 10px",
                                }}
                              >
                                <div
                                  className="animated-background"
                                  style={{ height: "15px" }}
                                ></div>
                              </div>
                            </div>

                            {/* stars rating */}
                            <div className="col-md-12 skeleton-card-title">
                              <div
                                className="placeholder"
                                style={{
                                  minHeight: "15px",
                                  maxWidth: "30%",
                                  margin: "5px 10px 10px",
                                }}
                              >
                                <div
                                  className="animated-background"
                                  style={{ height: "15px" }}
                                ></div>
                              </div>
                            </div>

                            {/* 2 */}
                            <div className="col-md-6 skeleton-card-title">
                              <div
                                className="placeholder"
                                style={{
                                  minHeight: "15px",
                                  maxWidth: "65%",
                                  margin: "5px 0 15px",
                                }}
                              >
                                <div
                                  className="animated-background"
                                  style={{ height: "15px" }}
                                ></div>
                              </div>
                            </div>

                            <div className="col-md-6 skeleton-card-title">
                              <div
                                className="placeholder"
                                style={{
                                  minHeight: "15px",
                                  maxWidth: "65%",
                                  margin: "5px 0 10px",
                                }}
                              >
                                <div
                                  className="animated-background"
                                  style={{ height: "15px" }}
                                ></div>
                              </div>
                            </div>
                            {/* row ending below */}
                          </div>

                          {/* ending name col */}
                        </div>
                      </div>

                      {/* chat section line */}
                      <div
                        className="placeholder"
                        style={{
                          minHeight: "22px",
                          maxWidth: "100%",
                          margin: "15px 0 15px",
                        }}
                      >
                        <div
                          className="animated-background"
                          style={{ height: "22px" }}
                        ></div>
                      </div>

                      {/* portfolio sec */}
                      <div className="row justify-content-between">
                        {/* top portfolio heading */}
                        <div className="col-md-9 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "12px",
                              maxWidth: "30%",
                              margin: "5px 0 0",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "12px" }}
                            ></div>
                          </div>
                        </div>
                        <div className="col-md-3 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "12px",
                              maxWidth: "80%",
                              margin: "5px 0 0",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "12px" }}
                            ></div>
                          </div>
                        </div>
                        {/*  portfolio img */}
                        <div className="col-md-12 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "200px",
                              maxWidth: "100%",
                              margin: "5px 0 10px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "200px" }}
                            ></div>
                          </div>
                        </div>

                        {/* portfolio description */}
                        <div className="col-md-12 skeleton-card-title">
                          {/* heading */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "20px",
                              maxWidth: "30%",
                              margin: "0px 0 10px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "20px" }}
                            ></div>
                          </div>

                          {/* show description */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "13px",
                              maxWidth: "100%",
                              margin: "5px 0 10px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "13px" }}
                            ></div>
                          </div>
                          {/* 2 line */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "13px",
                              maxWidth: "80%",
                              margin: "0px 0 25px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "13px" }}
                            ></div>
                          </div>
                        </div>
                      </div>

                      {/* transactions contract & rates sec line */}
                      <div className="row justify-content-between">
                        <div className="col-md-12 skeleton-card-title">
                          {/* transactions sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "75%",
                              margin: "15px 0 15px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>

                          {/* contract sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "40%",
                              margin: "5px 0 15px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>
                          {/*  */}

                          {/* hourly rates sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "60%",
                              margin: "15px 0 15px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>

                          {/* hourly rates sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "60%",
                              margin: "15px 0 15px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>

                          {/* active since sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "50%",
                              margin: "15px 0 20px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>

                          {/* border line */}
                          <border className="borderline_freelancerProfile"></border>

                          {/* no of employee */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "40%",
                              margin: "15px 0 35px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>
                          {/*  */}

                          {/* employee linkedin sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "80%",
                              margin: "15px 0 15px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>

                          {/* annual sales sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "20%",
                              margin: "5px 0 10px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>
                          {/*  */}

                          {/* border line */}
                          <border className="borderline_freelancerProfile"></border>

                          {/* store id sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "40%",
                              margin: "25px 0 15px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>

                          {/* visa card sec */}
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "18px",
                              maxWidth: "65%",
                              margin: "5px 0 35px",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "18px" }}
                            ></div>
                          </div>
                          {/*  */}
                        </div>
                      </div> 

                      {/* 1st col 4 profile ending */}
                    </div>

                    {/* ending */}
                  </div>
                </div>
                {/*  */}
              </div>

              {/* right area */}
              <div className="col-lg-8">
                <div
                  key={`skeleton${[i]}`}
                  className="card_box skeletonClientProfile_Card"
                  hidden={!isSkeletonLoading}
                  style={{ marginTop: i == 0 ? "20px" : "10px" }}
                >
                  <div className="row justify-content-between">
                    <div className="col-md-12">
                      {/* name line */}
                      <div className="row justify-content-between">
                        {/* img icon */}
                        <div className="col-md-1 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
                              minHeight: "22px",
                              maxWidth: "80%",
                              margin: "5px 0 0",
                            }}
                          >
                            <div
                              className="animated-background"
                              style={{ height: "22px" }}
                            ></div>
                          </div>
                        </div>
                        {/* name */}
                        <div className="col-md-11 skeleton-card-title">
                          <div
                            className="placeholder"
                            style={{
